import React, { useState } from "react";
import { useNavigate } from 'react-router-dom';

const Login = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();
    
    const handlelogin = () => {
        if (username === 'tranlamnhu' && password === 'khung') {
            navigate('/home');
        }
        else{
            alert('Đăng nhập không thành công!. Kiểm tra lại cái coi đcm');
        }
    };

    return (
        <div class="container mt-5 pt-5">
            <div class="row">
                <div class="col-12 col-sm-6 col-md-5 m-auto">
                    <div class="card border-0 shadow p-5 ">
                        <div class="card-body">
                            <h2 class ="text-center">Đăng nhập</h2>
                            <form>
                                <div class="mb-3 mt-3">
                                    <input placeholder="Tên đăng nhập" class="form-control my-4 py-4" type="text" id="username" name="username" value={username} onChange={(e) => setUsername(e.target.value )} />
                                </div>
                                <div class="mb-3">
                                    <input placeholder="Mật khẩu" class ="form-control my-4 py-4" type="password" id="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} />
                                </div>
                                <div class="text-center mt-3">
                                <button type="submit" class="btn btn-primary" onClick={handlelogin}>Đăng nhập</button>
                                <a href="https://www.w3schools.com/bootstrap5/bootstrap_grid_xsmall.php" class="nav-link">Đã có mật khẩu?</a>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login;
